const s=document.querySelector("#search");s.addEventListener("keyup",function(o){const t=o.target.value.toLowerCase(),n=document.querySelectorAll(".search");Array.from(n).forEach(function(e){let r=e.querySelector(".name").textContent,a=e.querySelector(".email").textContent;r.toLowerCase().indexOf(t)!=-1||a.toLowerCase().indexOf(t)!=-1?e.classList.remove("d-none"):e.classList.add("d-none")})});
